INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('50', '1', '420 Humboldt T-Shirt (blue)', '&lt;p&gt;The bright blue Humboldt hippy 420 shirt!&lt;/p&gt;\r\n\r\n&lt;p&gt;Comfortable and made with care, this tie-dye T is perfect for chillin\' in a good mood!&lt;/p&gt;', '', '420B', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('51', '1', 'BMM T-Shirt (camo)', '&lt;p&gt;The white BMM T-Shirt with the camo logo!&lt;/p&gt;\r\n\r\n&lt;p&gt;Comfortable and made with care, this powerful tee is for the OGs in the game!&lt;/p&gt;', '', 'BMMC', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('52', '1', 'UnderRated Clique Hoodie', '&lt;p data-end=&quot;608&quot; data-start=&quot;92&quot;&gt;Elevate your streetwear game with this sleek &lt;strong data-end=&quot;165&quot; data-start=&quot;137&quot;&gt;UnderRated Clique Hoodie&lt;/strong&gt;, crafted for those who appreciate both style and comfort. The bold &lt;strong data-end=&quot;244&quot; data-start=&quot;233&quot;&gt;UC logo&lt;/strong&gt; on the front, paired with the iconic “UnderRated Clique” text in striking &lt;strong data-end=&quot;337&quot; data-start=&quot;319&quot;&gt;blue and white&lt;/strong&gt;, makes a statement wherever you go. Whether you\'re chilling with friends or out on the go, this hoodie delivers the perfect blend of premium quality and effortless style. Made with a soft, cozy fabric and a classic black design, it’s the ultimate piece for any wardrobe.&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;743&quot; data-start=&quot;610&quot;&gt;Perfect for layering or wearing solo, this hoodie speaks to those who understand that being underrated is the true mark of greatness.&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;765&quot; data-start=&quot;745&quot;&gt;&lt;strong data-end=&quot;765&quot; data-start=&quot;745&quot;&gt;Product Details:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul data-end=&quot;980&quot; data-start=&quot;766&quot;&gt;\r\n\t&lt;li data-end=&quot;808&quot; data-start=&quot;766&quot;&gt;\r\n\t&lt;p data-end=&quot;808&quot; data-start=&quot;768&quot;&gt;Soft, durable fabric for maximum comfort&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;874&quot; data-start=&quot;809&quot;&gt;\r\n\t&lt;p data-end=&quot;874&quot; data-start=&quot;811&quot;&gt;Classic black design with blue &amp;amp; white “UnderRated Clique” text&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;915&quot; data-start=&quot;875&quot;&gt;\r\n\t&lt;p data-end=&quot;915&quot; data-start=&quot;877&quot;&gt;UC logo for that subtle yet bold touch&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;980&quot; data-start=&quot;916&quot;&gt;\r\n\t&lt;p data-end=&quot;980&quot; data-start=&quot;918&quot;&gt;Perfect for casual wear or adding a pop of style to any outfit&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p data-end=&quot;1036&quot; data-start=&quot;982&quot;&gt;Stay fresh, stay true. Join the &lt;strong data-end=&quot;1035&quot; data-start=&quot;1014&quot;&gt;Underrated Clique&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', 'UCH', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('53', '1', '420 UnderRated Hat (camo)', '&lt;p&gt;This camo baseball hat features a bold, green &quot;420&quot; embroidered on the front, making it a perfect choice for those who want to show their love for cannabis culture. The hat’s camouflage pattern adds a rugged, outdoorsy vibe, while the vibrant green lettering stands out, making a statement wherever you go. Its classic baseball cap style with an adjustable strap ensures a comfortable fit, and the breathable fabric keeps you cool. Whether you’re out on a hike or just chilling with friends, this hat is a stylish and subtle way to represent your 420 spirit.&lt;/p&gt;', '', '420HC', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('54', '1', 'CD- Black Markets Matter (Autographed)', '&lt;p&gt;This underground hip-hop CD is a deep dive into the gritty world of weed and black market culture, bringing raw, unfiltered storytelling to the forefront. Packed with hard-hitting beats and thought-provoking lyrics, this album explores the highs and lows of life in the shadows, from the hustle of the underground marijuana trade to the changing &quot;legal&quot; world. With each track, the artists paint vivid pictures of survival, rebellion, and the untold truths behind the black market. Perfect for fans of authentic, underground weed music, this CD delivers a unique sound that captures the essence of the black market life, making it a must-have for anyone looking for an unvarnished perspective on weed culture and the way the game used to be.&lt;/p&gt;', '', 'CDBMM', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('55', '1', 'Humboldt OG T-Shirt', '&lt;p&gt;This black T-shirt features a bold design inspired by the iconic Humboldt County, known for its legendary weed culture. The front of the shirt showcases a striking graphic of an arm with a joint burning, surrounded by vibrant green hues and intricate details that highlight the natural beauty of Humboldt’s rich marijuana heritage. The text “Humboldt” is emblazoned across the stomach in a cool, modern font, reflecting the region’s laid-back vibe. Made from soft, breathable fabric, this shirt is perfect for showing off your appreciation for quality weed and the West Coast culture. Whether you\'re a local or just a fan, this tee is a must-have addition to your wardrobe.&lt;/p&gt;', '', 'HOGT', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('56', '1', 'Humboldt Hat (sold out)', '&lt;p&gt;This black baseball cap features &quot;Humboldt&quot; boldly stitched across the front in a sleek, modern font, paying homage to the iconic Northern California region. Made from high-quality, durable fabric, the cap offers a comfortable fit with an adjustable strap at the back for a customizable feel. The classic black color pairs effortlessly with any casual outfit, making it a versatile accessory for everyday wear. Whether you\'re repping Humboldt\'s famous cannabis culture or simply love the laid-back vibe of the area, this cap is the perfect way to show your pride in style.&lt;/p&gt;', '', 'HH', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('57', '1', 'Window Cling, Lighters, Stickers', '&lt;article data-scroll-anchor=&quot;false&quot; data-testid=&quot;conversation-turn-5&quot; dir=&quot;auto&quot;&gt;\r\n&lt;p data-end=&quot;572&quot; data-is-last-node=&quot;&quot; data-start=&quot;0&quot;&gt;This collection of accessories is perfect for anyone who vibes with the underground weed and music culture. Featuring bold designs that speak to both cannabis enthusiasts and music lovers, these items are a unique way to represent your passions.&lt;/p&gt;\r\n&lt;/article&gt;\r\n\r\n&lt;article data-scroll-anchor=&quot;true&quot; data-testid=&quot;conversation-turn-7&quot; dir=&quot;auto&quot;&gt;\r\n&lt;ul data-end=&quot;1098&quot; data-start=&quot;247&quot;&gt;\r\n\t&lt;li data-end=&quot;512&quot; data-start=&quot;247&quot;&gt;\r\n\t&lt;p data-end=&quot;512&quot; data-start=&quot;249&quot;&gt;&lt;strong data-end=&quot;265&quot; data-start=&quot;249&quot;&gt;Window Cling&lt;/strong&gt;: A high-quality, reusable window cling with a vibrant design that showcases your love for underground weed culture and music. Easy to apply and remove without leaving residue, it’s the perfect way to add some style to your ride or personal space.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;783&quot; data-start=&quot;514&quot;&gt;\r\n\t&lt;p data-end=&quot;783&quot; data-start=&quot;516&quot;&gt;&lt;strong data-end=&quot;528&quot; data-start=&quot;516&quot;&gt;Lighters&lt;/strong&gt;: These sleek, durable lighters come adorned with eye-catching artwork inspired by underground cannabis and music scenes. Compact, functional, and full of attitude, they’re a must-have accessory whether you’re lighting up or simply showing off your style.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;1098&quot; data-start=&quot;785&quot;&gt;\r\n\t&lt;p data-end=&quot;1098&quot; data-start=&quot;787&quot;&gt;&lt;strong data-end=&quot;799&quot; data-start=&quot;787&quot;&gt;Stickers&lt;/strong&gt;: Bold and edgy stickers that represent the fusion of cannabis culture and underground music. Stick them anywhere to make a statement—whether it\'s on your laptop, water bottle, or gear. These stickers are designed to stand out and are made to last, perfect for those who love to rep their lifestyle.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p data-end=&quot;1360&quot; data-is-last-node=&quot;&quot; data-start=&quot;1100&quot;&gt;Each item in this set captures the rebellious spirit of the underground scene, combining the love of music, weed, and self-expression in one package. Whether you\'re looking to decorate, light up, or tag your gear, these accessories are made to match your vibe.&lt;/p&gt;\r\n&lt;/article&gt;', '', 'MISC', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('58', '1', 'Growin\' Ain\'t Easy T-shirt', '&lt;p&gt;Show off your love for the realest in the game with this black t featuring an iconic album cover from one of the most underrated artists in hip-hop. With a design inspired by the raw energy of the album &lt;em data-end=&quot;319&quot; data-start=&quot;299&quot;&gt;Growin\' Ain\'t Easy&lt;/em&gt;, this shirt pays tribute to the best weed rapper alive. Whether you\'re a fan of his laid-back flow or his sharp lyricism, this shirt is for those who truly appreciate the grind. Crafted with comfort in mind, it’s perfect for a chill day or showing off your taste in underground rap. Wear it with pride and let everyone know: this artist may be underrated, but his legacy is about to be anything but easy to ignore.&lt;/p&gt;', '', 'HOGT', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('59', '1', 'Growin\' Ain\'t Easy Bundle 1', '&lt;p data-end=&quot;37&quot; data-start=&quot;0&quot;&gt;&lt;strong data-end=&quot;37&quot; data-start=&quot;0&quot;&gt;Growin\' Ain\'t Easy Bundle Description:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;365&quot; data-start=&quot;39&quot;&gt;Show your love for the music and the culture with this exclusive album bundle with limited edition souvenirs! Featuring a premium quality t-shirt that showcases artwork from the latest album, this bundle brings you closer to the artist\'s world. The shirt is made with soft, breathable fabric for maximum comfort while you rep your favorite tracks.&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;810&quot; data-start=&quot;367&quot;&gt;But that\'s not all – this special bundle includes a set of exclusive souvenirs that take your experience to the next level. Think limited-edition posters, autographed memorabilia, and other one-of-a-kind goodies that every true fan will treasure. Perfect for wearing while vibing to the music or displaying in your collection, this package is a must-have for any die-hard fan looking to support the artist and take home a piece of the journey.&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;832&quot; data-start=&quot;812&quot;&gt;&lt;strong data-end=&quot;832&quot; data-start=&quot;812&quot;&gt;What\'s included:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul data-end=&quot;974&quot; data-start=&quot;833&quot;&gt;\r\n\t&lt;li data-end=&quot;870&quot; data-start=&quot;833&quot;&gt;\r\n\t&lt;p data-end=&quot;870&quot; data-start=&quot;835&quot;&gt;Limited edition album cover t-shirt&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;922&quot; data-start=&quot;907&quot;&gt;\r\n\t&lt;p data-end=&quot;922&quot; data-start=&quot;909&quot;&gt;(3) Uppercut feminized souvenirs&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;974&quot; data-start=&quot;950&quot;&gt;\r\n\t&lt;p data-end=&quot;974&quot; data-start=&quot;952&quot;&gt;Digital album download&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p data-end=&quot;1082&quot; data-start=&quot;976&quot;&gt;Grab yours before it’s gone – it’s more than just merch, it’s a celebration of the music and the movement!&lt;/p&gt;', '', 'GAEB1', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('60', '1', '420 Humboldt Jersey (green)', '&lt;p&gt;Stand out with this sleek and stylish black jersey, designed for those who embrace a bold lifestyle, featuring vibrant green lettering and numbers combines comfort and attitude. Perfect for casual wear or making a statement, the breathable fabric ensures you stay cool and confident no matter where you go.&lt;/p&gt;\r\n\r\n&lt;p&gt;ideal for smokers who want to express their personality, this jersey is all about individuality and flair. With its relaxed fit and durable material, its built for both comfort and style - whether youre hanging out with friends or just relaxing in your favorite spot.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', '420GJ', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('61', '1', '420 UnderRated Hat', '&lt;p&gt;This black baseball hat features a bold, blue &quot;420&quot; embroidered on the front, making it a perfect choice for those who want to show their love for cannabis culture. The hat’s camouflage pattern adds a rugged, outdoorsy vibe, while the vibrant green lettering stands out, making a statement wherever you go. Its classic baseball cap style with an adjustable strap ensures a comfortable fit, and the breathable fabric keeps you cool. Whether you’re out on a hike or just chilling with friends, this hat is a stylish and subtle way to represent your 420 spirit.&lt;/p&gt;', '', '420HB', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('62', '1', 'Make Weed Illegal Again', '&lt;p&gt;Turn heads and spark conversations with this bold, playful twist on the iconic &quot;Make America Great Again&quot; hat. Crafted from high-quality, durable fabric, this eye-catching red cap features the slogan &quot;Make Weed Illegal Again&quot; in bold, white letters, sure to get people talking. Perfect for anyone with a sense of humor and a love for standing out, this hat is a statement piece that\'s as comfortable as it is controversial. Wear it to make a point, or just to enjoy some laughs—either way, you\'re guaranteed to turn some heads!&lt;/p&gt;', '', 'MWIAH', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('63', '1', 'Make Weed Illegal Again (camo)', '&lt;p&gt;The camo hat will turn heads and spark conversations with this bold, playful twist on the iconic &quot;Make America Great Again&quot; hat. Crafted from high-quality, durable fabric, this eye-catching red cap features the slogan &quot;Make Weed Illegal Again&quot; in bold, white letters, sure to get people talking. Perfect for anyone with a sense of humor and a love for standing out, this hat is a statement piece that\'s as comfortable as it is controversial. Wear it to make a point, or just to enjoy some laughs—either way, you\'re guaranteed to turn some heads!&lt;/p&gt;', '', 'MWIAC', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('64', '1', 'CD- Smoke Sessions (Autographed)', '&lt;p data-end=&quot;160&quot; data-start=&quot;83&quot;&gt;&lt;strong data-end=&quot;160&quot; data-start=&quot;83&quot;&gt;3 Mix Tapes for the Ultimate 4/20 Smoke Session plus 2 previously unreleased songs&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;516&quot; data-start=&quot;162&quot;&gt;Get ready to elevate your 4/20 celebrations with our exclusive CD featuring three specially curated mixtapes, each designed to set the perfect vibe for your smoke sessions. Whether you\'re vibing solo, chilling with friends, or just looking to unwind, these tracks will guide you through a variety of moods—from laid-back and mellow to hyped-up and heady.&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;536&quot; data-start=&quot;518&quot;&gt;&lt;strong data-end=&quot;536&quot; data-start=&quot;518&quot;&gt;What’s inside:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul data-end=&quot;901&quot; data-start=&quot;537&quot;&gt;\r\n\t&lt;li data-end=&quot;646&quot; data-start=&quot;537&quot;&gt;\r\n\t&lt;p data-end=&quot;646&quot; data-start=&quot;539&quot;&gt;&lt;strong data-end=&quot;554&quot; data-start=&quot;539&quot;&gt;Smoke Session 1:&lt;/strong&gt; Chill and relax with smooth beats and ambient soundscapes perfect for a peaceful solo sesh.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;765&quot; data-start=&quot;647&quot;&gt;\r\n\t&lt;p data-end=&quot;765&quot; data-start=&quot;649&quot;&gt;&lt;strong data-end=&quot;664&quot; data-start=&quot;649&quot;&gt;Smoke Session 2:&lt;/strong&gt; Step it up with upbeat jams and funky rhythms that keep the energy flowing while you pass the joint.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;901&quot; data-start=&quot;766&quot;&gt;\r\n\t&lt;p data-end=&quot;901&quot; data-start=&quot;768&quot;&gt;&lt;strong data-end=&quot;783&quot; data-start=&quot;768&quot;&gt;Smoke Session 3:&lt;/strong&gt; Close out your session with heavy bass, smooth flows, and trippy tunes that will keep you in the zone all night long.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p data-end=&quot;1155&quot; data-start=&quot;903&quot;&gt;Perfect for smokers, stoners, and music lovers alike, this CD is the ultimate soundtrack to your 4/20. Whether you\'re a seasoned veteran or a first-time enthusiast, these mixes will ensure your smoke session goes up in smoke (in the best way possible).&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;1207&quot; data-start=&quot;1157&quot;&gt;Grab yours today and make your 4/20 unforgettable!&lt;/p&gt;', '', 'CDSS', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('65', '1', 'BMM T-Shirt (blue)', '&lt;p&gt;The black BMM T-Shirt with the blue logo!&lt;/p&gt;\r\n\r\n&lt;p&gt;Comfortable and made with care, this powerful tee is for the OGs in the game!&lt;/p&gt;', '', 'BMMB', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('66', '1', 'Best Weed Rapper Alive', '&lt;p&gt;&quot;Show off your love for the culture with the &lt;strong data-end=&quot;71&quot; data-start=&quot;45&quot;&gt;Best Weed Rapper Alive&lt;/strong&gt; T-shirt. Crafted from high-quality, breathable cotton, this bold black tee lets everyone know you’re repping the best in the game. Featuring a sleek design, this shirt is the perfect blend of style and swagger, ideal for any true fan of hip-hop and weed culture. Proudly made in Humboldt, where quality runs deep, this tee is a must-have for anyone who knows that the best things in life come from the roots up. Wear it loud, wear it proud—because when it comes to weed and rap, this one’s untouchable.&quot;&lt;/p&gt;', '', 'BWRAT', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('67', '1', '420 T-Shirt (tie dye)', '&lt;p&gt;The tie dye hippy 420 shirt!&lt;/p&gt;\r\n\r\n&lt;p&gt;Comfortable and made with care, this tie-dye T is perfect for chillin\' in a good mood!&lt;/p&gt;', '', '420TD', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('68', '1', 'BMM T-Shirt (green)', '&lt;p&gt;The black BMM T-Shirt with the green logo!&lt;/p&gt;\r\n\r\n&lt;p&gt;Comfortable and made with care, this powerful tee is for the OGs in the game!&lt;/p&gt;', '', 'BMMG', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('69', '1', 'Smoke Sesh Shirt', '&lt;p data-end=&quot;163&quot; data-start=&quot;95&quot;&gt;&lt;strong data-end=&quot;163&quot; data-start=&quot;95&quot;&gt;&quot;Smoke Session&quot; Black T-Shirt – Perfect for Dab Lovers &amp;amp; Stoners&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;608&quot; data-start=&quot;165&quot;&gt;Elevate your chill vibe with the official&amp;nbsp;&lt;strong data-end=&quot;231&quot; data-start=&quot;198&quot;&gt;&quot;Smoke Session&quot; Black T-Shirt&lt;/strong&gt;, designed for those who appreciate a great session. This t-shirt makes a statement wherever you go. Whether you’re hanging out with friends, hitting a sesh, or just rocking your style, this tee is perfect for showcasing your love for the culture.&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;966&quot; data-start=&quot;610&quot;&gt;Crafted from soft, high-quality fabric, this black t-shirt offers all-day comfort and durability, making it the ultimate addition to any stoner’s wardrobe. It’s available in a variety of sizes, so you can find your perfect fit. Whether you\'re a dab enthusiast or just love the weed community, this tee will help you express your personality with flair.&lt;/p&gt;', '', 'SST', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('70', '1', '420 Humboldt Jersey (blue)', '&lt;p&gt;Stand out with this sleek and stylish black jersey, designed for those who embrace a bold lifestyle, featuring vibrant blue lettering and numbers combines comfort and attitude. Perfect for casual wear or making a statement, the breathable fabric ensures you stay cool and confident no matter where you go.&lt;/p&gt;\r\n\r\n&lt;p&gt;ideal for smokers who want to express their personality, this jersey is all about individuality and flair. With its relaxed fit and durable material, its built for both comfort and style - whether youre hanging out with friends or just relaxing in your favorite spot.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', '420BJ', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('71', '1', 'UnderRated Click T-Shirt', '&lt;p data-end=&quot;548&quot; data-start=&quot;88&quot;&gt;Represent the vibe with the &lt;strong data-end=&quot;137&quot; data-start=&quot;116&quot;&gt;UnderRated Clique&lt;/strong&gt; black t-shirt. Featuring bold “Underrated Clique” text in fresh &lt;strong data-end=&quot;220&quot; data-start=&quot;202&quot;&gt;blue and white&lt;/strong&gt; and the signature &lt;strong data-end=&quot;250&quot; data-start=&quot;239&quot;&gt;UC logo&lt;/strong&gt;, this shirt is all about embracing the power of staying true to yourself. Whether you\'re rocking it casually or dressing it up, this tee brings an effortless style that\'s as laid-back as it is bold. Crafted from soft, breathable fabric, it’s made for all-day comfort without compromising on style.&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;732&quot; data-start=&quot;550&quot;&gt;Perfect for pairing with jeans, shorts, or layering with your favorite jacket, this shirt is a must-have for anyone who knows that the most underrated are often the most unstoppable.&lt;/p&gt;\r\n\r\n&lt;p data-end=&quot;754&quot; data-start=&quot;734&quot;&gt;&lt;strong data-end=&quot;754&quot; data-start=&quot;734&quot;&gt;Product Details:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul data-end=&quot;932&quot; data-start=&quot;755&quot;&gt;\r\n\t&lt;li data-end=&quot;798&quot; data-start=&quot;755&quot;&gt;\r\n\t&lt;p data-end=&quot;798&quot; data-start=&quot;757&quot;&gt;Soft, comfortable fabric for all-day wear&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;848&quot; data-start=&quot;799&quot;&gt;\r\n\t&lt;p data-end=&quot;848&quot; data-start=&quot;801&quot;&gt;Bold “Underrated Clique” text in blue and white&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;883&quot; data-start=&quot;849&quot;&gt;\r\n\t&lt;p data-end=&quot;883&quot; data-start=&quot;851&quot;&gt;UC logo for that signature touch&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li data-end=&quot;932&quot; data-start=&quot;884&quot;&gt;\r\n\t&lt;p data-end=&quot;932&quot; data-start=&quot;886&quot;&gt;A versatile addition to your everyday wardrobe&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p data-end=&quot;991&quot; data-start=&quot;934&quot;&gt;Stay cool, stay bold, and join the &lt;strong data-end=&quot;990&quot; data-start=&quot;969&quot;&gt;UnderRated Clique&lt;/strong&gt;.&lt;/p&gt;', '', 'UCT', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('72', '1', 'Best Weed Rapper Alive (hoodie)', '&lt;p&gt;&quot;Show off your love for the culture with the &lt;strong data-end=&quot;71&quot; data-start=&quot;45&quot;&gt;Best Weed Rapper Alive&lt;/strong&gt;&amp;nbsp;hoodie. Crafted from high-quality, breathable cotton, this bold black sweatshirt lets everyone know you’re repping the best in the game. Featuring a sleek design, this shirt is the perfect blend of style and swagger, ideal for any true fan of hip-hop and weed culture. Proudly made in Humboldt, where quality runs deep, this hoodie is a must-have for anyone who knows that the best things in life come from the roots up. Wear it loud, wear it proud—because when it comes to weed and rap, this one’s untouchable.&quot;&lt;/p&gt;', '', 'BWRAH', '', '');
